import logo from './logo.svg';
import './App.css';
import './index.css';
import ReactSearchBox from 'react-search-box'





function App() {
  return (
    <div className="App">
      <button className = "loginButton">Login</button>

      <p className="helloWorld">
        Hello World
        <ReactSearchBox
        placeholder="Search a course"
        value="Doe"
        className='searchBarContainer'
      />
      </p>


    </div>


  );
}

export default App;
